unsigned int move(unsigned int dir)
{
    unsigned char p;
    p=world[search_room(current_position)].directions[dir];
    if(p) {
        next_position=p;        marker[120]=false;
        return 1;
    } else 
        show_message(message1008);
    return 0;
}

boolean get(unsigned int o)
{
    odummy=&obj[search_object(o)];
    if(odummy->position!=current_position) {
        show_message(message1006);
        return true;
    } else if(odummy->isnotmovable==false) {
        show_message(message1005);
        return true;
    } else if(counter[120]+odummy->weight>counter[122]){ 
        show_message(message1003);
            return true;
    } else if(counter[124]+odummy->size>counter[121]) {
        show_message(message1004);
        return true;
    } else {
        odummy->position=CARRIED;
        ++counter[119];
        counter[120]+=odummy->weight;
        counter[124]+=odummy->size;
    }
    return false;
}
